export default interface IQuery<Schema> {
    $include: Array<keyof Schema> | keyof Schema;
    $where: {
        $lt?: number;
        $lte?: number;
        $gt?: number;
        $gte?: number;
        $eqt?: number;
        $startsw?: string;
        $endsw?: string;
        $incl?: any;
        $at?: [number, any];
        $length: number;
    };
}
